        "explanation": "<p>\n   إذا كان لسبب لا يوافق المستخدم مع مجتمع الأصناف، \n \\ فإنه يمكنهم رفضه: وهو ما يعني أن معرفاتهم هي التي تُستخدَم  \n  لربط الملاحظات الأخرى، وتحديث قوائم الحياة، وما إلى ذلك، ويعني أيضا أنه\n  يمكن لملاحظتهم فقط أن تصبح درجة بحث عندما \n  يتفق المجتمع معهم. \n</p>\n<p>\n  ومع ذلك، لا يزال معرف المجتمع معروضا; لذا قد تظهر جميع \n  المعرفات المختلفة التي تم اقتراحها.\n</p>\n",
