        "too_many_results_desc": "عدد مرات الصفحة لا يمكن أن يتجاوز عدد النتائج لكل صفحة 10000، \nحاول تطبيق مرشحات لتقليل عدد النتائج، أو تعليم \nالملاحظات كمراجعة واستخدام زر \"عرض المزيد\" بدلا من \nترقيم الصفحات\n",
        "unreview_all_tooltip": "إزالة حالة المراجعة لجميع الملاحظات على الصفحة",
        "you_reviewed_message": "لقد راجعت %{reviewed} من %{pageTotal} ملاحظة على هذه الصفحة من إجمالي %{total} ملاحظة مطابقة."
