        "disagreement_count": "Recompte de desacords",
        "explanation": "<p>\nSi per algun motiu un usuari no està d'acord amb el tàxon de la comunitat, el poden refusar, el que significa que la seva identificació és la utilitzada per enllaçar amb altres observacions, actualitzant llistes de vida, etc. També significa que l'observació únicament pot ser de recerca si la comunitat està d'acord amb ella.\n</p>\n<p>\nTanmateix, la Identificació de la comunitat encara es mostrarà, de forma que tots poden veure les diferents identificacions que han estat suggerides.\n</p>\n",
