        "disagreement_count": "Počet neshod",
        "explanation": "<p>\nPokud uživatel z nějakého důvodu nesouhlasí s komunitním taxonem, může ho odmítnout, což znamená, že jeho ID se použije k propojení s dalšími pozorováními, aktualizaci seznamů života atd. Také to znamená, že jeho pozorování se může posunout na výzkumný stupeň jen tehdy, bude-li komunita souhlasit.\n</p>\n<p>\nID komunity je ale stále zobrazené, takže všichni vidí různá navržená ID.\n</p>\n",
