        "disagreement_count": "Uenigheds antal",
        "explanation": "<p>\nHvis en bruger af en eller anden grund er uenig med fællesskabs takson, kan de afvise den, hvilket betyder at det er deres eget ID, der bruges for at linke til andre observationer, opdatere livslisten, etc. Det betyder også at deres observation kun kan opnå forskningskvalitet hvis fællesskabet er enige i deres identifikation.\n</p>\n<p>\nDog vises fællesskabets ID stadig, så alle kan se de forskellige ID der er blevet foreslået.\n</p>\n",
