        "explanation": "<p>\nSi por algún motivo un usuario no está de acuerdo con el taxón comunitario, lo pueden rechazar, lo que significa que su ID será la usada para enlazar con otras observaciones, actualizar listas de vida, etc. También significa que su observación únicamente puede pasar a ser de grado de investigación si la comunidad está de acuerdo.\n</p>\n<p>\nAun así, la identificación de la comunidad se seguirá mostrando, por lo que todos pueden ver que se ha sugerido una identificación diferente IDs.\n</p>\n",
