        "disagreement_count": "Erimeelsuste arv",
        "explanation": "<p>\nKui kasutaja mingil põhjusel ei nõustu kogukondliku taksoniga, saavad nad selle tagasi lükata, mis tähendab, et teiste vaatlustega seostamiseks, elunimekirjade täiendamiseks, jne kasutatakse nende endi pakutud määratlust. Samas tähendab see ka seda, et see vaatlus saab teaduskõlbulikuks alles siis, kui kogukond sellega nõustub.\n</p>\n<p>\nSamas näidatakse kogukondlikku määratlust edasi, et kõik erinevad pakutud määratlused oleksid nähtavad.\n</p>\n",
