      "show": {
        "ancestor_disagreements_desc": "Määratletud taksonite hulk, milles sisalduvad antud taksoni ülemtaksonid, kuid mis ei nõustu antud taksoniga (st \"Ma arvan, et tegu on selle perekonnnaga, kuid ei usu, et tegu on selle liigiga\")",
        "community_taxon_desc_html": "<p class=\"ui\">\nKogukondlik takson (ehk kogukondlik määratlus) tähistab seda, mida lehe %{site_name} kogukond mingi vaatluse kohta arvab. Kui sind huvitab, kuidas me kogukondliku taksoni valime, vaata allpool olevaid algorütmi kohta käivaid märkuseid. Üldiselt proovime <strong>valida taksoni, millega enam kui 2/3 määratlejatest nõustuvad</strong>. Mõnikord tähendab see seda, et peame valima kõrgema tasema taksoni, milles sisalduvad arvamuste vastuolud (nt kui sina arvad, et tegu on kuningmaoga, ja mina arvan, et tegu on lõgismaoga, valib iNat alamseltsi Serpentes, mis sisaldab kõik madusid). Algorütm eelistab vähesel määral ebakõla, sest oleme avastanud, et mittenõustujatel on sageli õigus.\n</p>\n<p class=\"ui\">\nTeaduskõlbulik vaatlus peab (muuhulgas) omama ka kogukondlikku taksonit. Kui vaatlusel on vaid üks määratlus, siis sel puudub kogukondlik takson. Kõiigil vaatlustel, millel on vähemalt üks määratlus, on olemas ka vaatluse takson. Vaatluse taksonit kasutame vaatluste jagamisel andmepartneritega, vaatluste seostamiseks sama taksoniga, sinu elunimekirja täiendamiseks, jne. Enamasti saab vaatluse taksonist ka kogukondlik takson, kuid mõnikord need erinevad, sest kogukond pole veel jõudnud määratluse osas üksmeelele. Kui sina näiteks arvad, et tegu on maoga (alamselts Serpentes) ning mina arvan, et tegu on kuningmaoga (perekond <i>Lampropeltis</i>), siis on vaatlustaksoniks kuningmadu (mis põhineb ainult minu määratlusel), kuid kogukondlikuks taksoniks on Serpentes (sest see tugineb vähemalt kahel määratlusel). Kui sa mingil põhjusel ei nõustu kogukondliku taksoniga, saad selle endale kuuluvate vaatluste puhul tagasi lükata, mis tähendab, et kogukondlikut taksonit ei panna kunagi vaatlustaksonit (selleks on siis su enda määratlus). Samuti tähendab see seda, et su vaatlus muutub teaduskõlbulikuks vaid siis, kui kogukond <em>sinuga</em> nõustub. Kui sulle mõte kogukondlikest taksonitest ei meeldi, võid neist täielikult keelduda <a href=\"/users/edit\" target=\"_blank\">muutes enda sätteid</a>.\n</p>\n<p class=\"ui\">\n<strong>Algorütm:</strong> kõigile määratletud taksonitele ja neid sisalduvatele taksonitele (st perekond <em>Homo</em> sisaldab liiki <em>Homo sapiens</em>) antakse skoor. Selleks on \"nõustujate\" (selle taksoni määratluste osa kõigist määratlustest), \"mittenõustujate\" (määratluste arv, mis on täiesti erinevad - st pakutud taksonis ei sisaldu hinnatav takson) ja \"alamtaksoni osas mittenõustujate\" (konservatiivsemad määratlused, mis ei nõustu täpsema taksoniga) suhtarv. Taksonite hulgast, mille skoor on suurem kui 2/3 ja millel on vähemalt 2 määratlejat, valitakse kõige madalama skooriga takson.\n</p>\n",
        "cumulative_count_desc": "Taksoni ja kõigi selle alamtaksonite määratluste hulk",
        "disagreement_count_desc": "Taksoni alamtaksonite seas mitte olevate määratluste hulk",
        "identification_count_desc": "Selle konkreetse taksoni määratluste hulk",
        "quality_assessment_help_html": "<p>\nAndmete kvaliteedihinnang on vaatluse täpsuse kokkuvõte. Kõik vaatlused on esmalt <strong>\"juhuvaatlused\"</strong> ning muutuvad <strong>\"vajab määramist\"</strong> vaatlusteks kui\n</p>\n\n<ul>\n<li>vaatlusel <strong>on kuupäev</strong></li>\n<li>vaatlusel <strong>on asukoha andmed</strong> (st laius- ja pikkuskraadid)</li>\n<li>vaatlusel <strong>on fotod või helid</strong></li>\n<li>vaatlus <strong>ei ole inimesest</strong></li>\n</ul>\n<p>\nVaatlused muutuvad <strong>\"teaduskõlbulikuks\"</strong> kui\n</p>\n<ul>\n<li>%{site_name} <strong>kogukond nõustub liigitäpsuse või täpsema määratlusega</strong>, st kui 2/3 määratlejatest nõustuvad mingi taksoniga</li>\n</ul>\n<p>\nVaatlus muutub uuesti <strong>\"juhuvaatluseks\"</strong>, kui ülalolevad tingimused pole täidetud või kogukond arvab,\n</p>\n<ul>\n<li>et <strong>asukoht ei näi olevat täpne</strong> (nt ahvid keset ookeani, jõehobud kontorihoones, jne)</li>\n<li>et <strong>organism pole metsik/kohandunud</strong> (nt inimeste poolt vangistatud või kasvatatud või sisaldab intelligentseid tulnukaid)</li>\n<li>et vaatlus <strong>ei sisalda mingi organismi olemasolu tundemärke</strong>, nt pildid maastikest, veekogudest, kividest, jne</li>\n<li>et vaatlus <strong>ei sisalda hiljutisi (~100 aastat) märke organismi kohalolust</strong> (nt kivistised, kuid väljaheited, jäljed ja kuivanud lehed sobivad)</li>\n<li>vaatlus ei vaja edasist määratlemist <em>ning</em> kogukondlik määratlus on vähemalt sugukonna tasemel</li>\n<li>vaatleja ei ole soovinud kogukondliku määratlust ning kogukondlik määratlus ei ole vaatleja määratluse täpsem versioon</li>\n</ul>\n<p>\nJa kui see pole veel piisavalt keeruline, siis eksisteerivad ka olukorrad, kus süsteem ise saab otsustada:\n</p>\n<ul>\n<li>Süsteem otsustab, et vaatlus pole metsik/kohandunud, kui väikseimas maakonna, osariigi või riigi tüüpi kohas, milles see vaatlus on tehtud, on vähemalt 10 teist liigi või täpsema taseme vaatlust, mis sisaldavad sama organismi, ning 80% neist on märgitud mitte metsikuks või kohandunuks.</li>\n</ul>\n",
        "score_desc": "skoor = koguarv / (koguarv + erimeelsuste arv + alamtaksonite ebakõlad)"
      }
