      "year": {
        "growth_by_country_desc_html": "Kus kasv toimub? See kaart ja graafik proovivad kasvu näidata riikide kaupa, mis tegelikult on keeruline, sest riigiti võib kasv olla väga erinev. Oleme vaikimisi otsustanud Ameerika Ühendriike mitte näidata ja kasutame logaritmilist skaalat, et rõhutada riikide erinevusi. Kui riik on musta värvi, siis tähendab see, et selle panus jäi alla protsendi, seal ei toimunud sellel aastal kasvu või seal polnud see aasta rohkem vaatluseid kui eelmisel (liigu hiirega riigile, et näha täpsemaid andmeid). <strong>\"% kogukasvust\"</strong> tähistab seda, kui suur osa kogu maailma kasvust tuli mingist riigist. Kui näiteks 2018. aastal toimus kokku 20 vaatlust ja 2017. aastal 10 ning 2018. aasta vaatlustest 5 toimus Beninis, siis Benini osa kogukasvust on 50%. <strong>\"% kasv\"</strong> tähistab tänavust vaatluste arvu riigis protsendina eelmise aasta tolle riigi vaatlustest. Kui näiteks Laoses oli eelmine aasta 10 vaatlust aga see aasta 20, siis oleks kasv 100%-i ning kui eelmine aasta oli 0 ja see aasta 1, siis oleks kasvuprotsent lõpmatu.\n",
        "growth_by_country_title": "Kasv riigiti",
        "growth_in_year_obs": "Kasv aastal %{year} (vaatlused)",
        "growth_title": "Kasv",
        "include_usa": "Kaasa USA",
        "new_species_desc_html": "Selle aasta jooksul esimest korda lisatud liigid. Vajuta mõnele kuule, et näha siis lisatud liike. Võid vaadata ka kogu liikide kasvutrendi või liigutada ajavalikud minevikku, et näha teisi äsja vaadeldud liike. Selles graafikus sisalduvad ainult tõendatavad vaatlused vastavalt lehele %{site_name} üles laadimise kuule (mitte vaatlemise kuule). Siin ei sisaldu kõrgema või madalama leveli taksonid, mis tähendab, et vaatlus määratlusega imetajad ei lähe arvesse ning <i>Canis lupus</i> alamliigi\n<i>arctos</i> vaatlus võrdub <i>Canis lupus</i> omaga.\n",
        "obs_in_year": "Vaatluseid aastal %{year}",
        "percent_growth_in_year": "% kasv aastal %{year}",
        "percent_of_total_growth": "% kogukasvust",
        "publications_desc_html": "Mõju andmed ja visualiseering <a href=\"https://www.altmetric.com\">Altmetricu</a> poolt. Info andmete kasutamise kohta pärineb meie sõpradelt lehel <a href=\"https://www.gbif.org/\">Global Biodiversity Information Faciltity</a>.\n<br/>\n<a href=\"%{url}\">Vaata kõiki %{numStudies} uurimust</a>\n",
        "sunburst_desc_html": "Vaadeldud taksonid on seatud mitmetasemelisse sektordiagrammi. Hierarhia alguspunkt on keskel alates sektoriga \"Elu\" ning lõppeb välisperimeetril olevate liikidega. Iga kaare suurus on võrdväärne tolle taksoni vaatluste arvuga ning värvid vastavad enam vähem meie \"ikoonilistele\" taksoni värvidele (taimed on rogelised, putukad kollased, ülejäänud loomad enamasti sinised, jne). Kui näed palju rohelist, tähendab see, et oled vaadelnud palju taimi. <strong>Vajuta mõnele kaarele, et paigutada seda keskele</strong> ning selle alamkategooriaid ümber selle või <strong>vajuta keskpunktile, et hierarhias kõrgemale liikuda</strong>.\n"
      }
