        "disagreement_count": "Onenigheid Aantal",
        "explanation": "<p>Als een gebruiker het niet eens is met het gemeenschapstaxon kan zij het weigeren. Haar determinatie is de naam die gebruikt wordt bij het koppelen aan andere waarnemingen, levenslijsten bijwerken, etc. De waarneming kan alleen onderzoekskwaliteit worden als de\ngemeenschap het met haar eens is.\n</p>\n<p>Het gemeenschaps-ID wordt echter nog steeds weergegeven, dus iedereen kan de verschillende ID's zien die zijn voorgesteld.\n</p>\n",
