  "cc_by_name": "Atributim",
  "cc_by_nc_description": "Kjo licencë lejon të tjerët të remixojnë, përpunojnë dhe të ndërtojnë mbi punën tuaj jo-komercialisht, dhe megjithëse punimet e tyre të reja duhet t'ju njohin dhe të jenë jo-komerciale, ata nuk duhet të licencojnë veprat e tyre të derivuara sipas kushteve të njëjta.",
