  "cc_by_nc_sa_description": "Kjo licencë lejon të tjerët të remixojnë, përpunojnë dhe të ndërtojnë mbi punën tuaj jo-komercialisht, për aq sa ata ju dhënë merita ju dhe licencojnë krijimet e tyre të reja nën kushte identike.",
